export default class PageTwo extends React.Component {
  render() {
    // includes
    const maximizeButton = (
      <div className="maximize green lighten-1">
      </div>
    )
    const minimizeButton = (
      <div className="minimize yellow lighten-1">
      </div>
    )
    const closeButton = (
      <div className="close red lighten-1">
      </div>
    )

    return (
      <div id="page-two-wrapper" className="container grey-text text-darken-3">
        <div className="slide-content-container">
          <div>
            <h3><b>my awesome portfolio</b></h3>
            <p className="description">Adipisicing aliqua irure excepteur ea in do. Cillum fugiat consequat sint deserunt non officia aliquip est quis aute dolore. Nisi dolor ut aute nostrud tempor incididunt officia ut anim ipsum minim irure veniam non.</p>
          </div>
          <div>
            <p className="grey-text text-darken-1">Anim nostrud do irure dolore dolor nostrud quis. dolore dolor nostrud quis.</p>
          </div>
          <div id="projects-container" className="row">
            <div className="col l6 m12 s12 project-card-container left-card">
              <div className="project-card">
                {maximizeButton}
                {minimizeButton}
                {closeButton}
                <div className="title-bar">
                  <h6 className="grey-text text-lighten-4">SAMPLE TITLE</h6>
                </div>
                <div id="project-card-image-container-0" className="project-card-image-container">

                </div>
              </div>
            </div>
            <div className="col l6 m12 s12 project-card-container right-card">
              <div className="project-card">
                {maximizeButton}
                {minimizeButton}
                {closeButton}
                <div className="title-bar">
                  <h6 className="grey-text text-lighten-4">SAMPLE TITLE</h6>
                </div>
                <div id="project-card-image-container-1" className="project-card-image-container">

                </div>
              </div>
            </div>
            <div className="col l6 m12 s12 project-card-container left-card">
              <div className="project-card">
                {maximizeButton}
                {minimizeButton}
                {closeButton}
                <div className="title-bar">
                  <h6 className="grey-text text-lighten-4">SAMPLE TITLE</h6>
                </div>
                <div id="project-card-image-container-2" className="project-card-image-container">

                </div>
              </div>
            </div>
            <div className="col l6 m12 s12 project-card-container right-card">
              <div className="project-card">
                {maximizeButton}
                {minimizeButton}
                {closeButton}
                {/* title bar */}
                <div className="title-bar">
                  <h6 className="grey-text text-lighten-4">SAMPLE TITLE</h6>
                </div>
                {/* image preview */}
                <div className="window-workspace-wrapper">
                  <div id="project-card-image-container-3" className="project-card-image-container">

                  </div>
                  {/* image overlay */}
                  {/* <div className="project-card-image-overlay">

                  </div> */}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
